function render (array, container) {
    let count = 0
    let idRow = 0
    array.forEach((i)=>{
        if(count == 0){
            idRow++
            container.innerHTML+=`
            <div class="row " id="id${idRow}">
                 <div class="mt-4 card text-center col-12 col-md-6 col-lg-3 col-xl-3">
                    <img src="${i.img}">
                    <p>${i.name}</p>
                    <p>${i.price}</p>
                    <button type="button" class="btn btn-primary ">Primary</button>
                 </div>
            </div>
            `
            count++
        }else if (count <= 2 ) {
            let row = document.querySelector(`#id${idRow}`)
            row.innerHTML+=`
            <div class="mt-4 card text-center col-12 col-md-6 col-lg-3 col-xl-3">
            <img src="${i.img}">
            <p>${i.name}</p>
            <p>${i.price}</p>
            <button type="button" class="btn btn-primary ">Primary</button>
            </div>
            `
            count++
        }
           else if (count == 3) {
                let row = document.querySelector(`#id${idRow}`)
                row.innerHTML+=`
                <div class="mt-4 card text-center col-12 col-md-6 col-lg-3 col-xl-3">
                <img src="${i.img}">
                <p>${i.name}</p>
                <p>${i.price}</p>
                <button type="button" class="btn btn-primary  ">Primary</button>
                </div>
                `
                count = 0
            }
    })
}
